import { Outlet, Link} from "react-router-dom";

const Layout = () => {
    return (
        <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/events">Events</Link>
          </li>
          <li>
            <Link to="/ourteam">Our Team</Link>
          </li>
        </ul>
      </nav>
    )
};

export default Layout;
